import{_ as a,o as e,c as t,Q as l}from"./chunks/framework.ea16e930.js";const o="/assets/UI.8cc007f8.png",_=JSON.parse('{"title":"Universal SaveData Chapter Tool","description":"A tool for managing save data chapters.","frontmatter":{"title":"Universal SaveData Chapter Tool","description":"A tool for managing save data chapters.","tags":["Tool"],"author":"LeafFall","date":"2023-9-28"},"headers":[],"relativePath":"software/save-chapter-tool/index.md","filePath":"software/save-chapter-tool/index.md"}'),r={name:"software/save-chapter-tool/index.md"},s=l('<h1 id="universal-savedata-chapter-tool" tabindex="-1">Universal SaveData Chapter Tool <a class="header-anchor" href="#universal-savedata-chapter-tool" aria-label="Permalink to &quot;Universal SaveData Chapter Tool&quot;">​</a></h1><div class="info custom-block"><p class="custom-block-title">简要信息</p><p>链接: <a href="https://github.com/TeaRed-LeafFall" target="_blank" rel="noreferrer">作者: LeafFall</a> | <a href="https://github.com/TeaRed-LeafFall/UniversalSaveDataChapterTool" target="_blank" rel="noreferrer">项目链接</a> | <a href="https://github.com/TeaRed-LeafFall/UniversalSaveDataChapterTool/releases/latest/" target="_blank" rel="noreferrer">下载链接</a></p><p>标签: C# Winform | 工具 | 开源 (The Unlicense 许可<sup class="footnote-ref"><a href="#fn1" id="fnref1">[1]</a></sup>) | 免费</p><p>依赖: Microsoft .NET Framework 4.7.2</p></div><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p><strong>Universal SaveData Chapter Tool</strong></p><p>是一个实现存档位扩展功能，方便存档不够用的玩家和加载以前的存档的工具。</p><div class="warning custom-block"><p class="custom-block-title">注意</p><p>请确保你的游戏存档为热加载(也就是重新加载存档界面时会实时变化)。</p><p>我们不能保证该工具适用您的游戏，这主要取决于游戏系统和引擎自身。</p></div><details class="details custom-block"><summary>目前已知兼容性</summary><p>已知兼容的引擎:</p><ul><li>KrkrZ的几乎全部游戏</li><li>Favorite View Point System</li><li>Cat System 2</li><li>还有更多...</li></ul><p>已知不完全兼容的引擎(需要重启,因为是冷加载):</p><ul><li>RealLiveEngine</li><li>SiglusEngine</li><li>还有更多...</li></ul></details><h3 id="简易的操作指示" tabindex="-1">简易的操作指示 <a class="header-anchor" href="#简易的操作指示" aria-label="Permalink to &quot;简易的操作指示&quot;">​</a></h3><p>请加载对应游戏的存档位置（选择注册，打开文件夹或者拖动文件夹到窗口）</p><p>如果加载完成了将会保存已经被集合记录的文件夹（在SaveDataPaths.txt）</p><p>操作非常简单，基本无需教程</p><h3 id="界面预览" tabindex="-1">界面预览 <a class="header-anchor" href="#界面预览" aria-label="Permalink to &quot;界面预览&quot;">​</a></h3><p><img src="'+o+'" alt="界面"></p><h2 id="更新日志" tabindex="-1">更新日志 <a class="header-anchor" href="#更新日志" aria-label="Permalink to &quot;更新日志&quot;">​</a></h2><h3 id="_2023-9-28" tabindex="-1">2023.9.28 <a class="header-anchor" href="#_2023-9-28" aria-label="Permalink to &quot;2023.9.28&quot;">​</a></h3><p>中秋节更新！！🥮🥮</p><ol><li>界面可以最小化了，支持可调节的窗口（已经足够了）。</li><li>让文件列表使用文件名，而不是完整路径。</li><li>添加了删除功能！！</li><li>界面重新写(更简洁，好看了一点，Winform界面只能这样了哦！)</li><li>代码重新整理了一下</li></ol><h3 id="_2023-8-25" tabindex="-1">2023.8.25 <a class="header-anchor" href="#_2023-8-25" aria-label="Permalink to &quot;2023.8.25&quot;">​</a></h3><p>第一个正式版。 测试过基本没有任何问题。</p><hr class="footnotes-sep"><section class="footnotes"><ol class="footnotes-list"><li id="fn1" class="footnote-item"><p><a href="https://choosealicense.com/licenses/unlicense/" target="_blank" rel="noreferrer">The Unlicense</a> <a href="#fnref1" class="footnote-backref">↩︎</a></p></li></ol></section>',21),i=[s];function n(c,h,p,d,f,u){return e(),t("div",null,i)}const v=a(r,[["render",n]]);export{_ as __pageData,v as default};
